import React from "react";
import Fade from "react-reveal/Fade";
import WorkCard from "./cards/WorkCard";
import xLogo from "../static/images/X.jpg";
import telenorLogo from "../static/images/logos/telenor.png";
import easypaisaLogo from "../static/images/logos/easypaisa.png";
import synergyLogo from "../static/images/logos/synergy.png";
import nucesLogo from "../static/images/logos/nuces.png";
import vecLogo from "../static/images/logos/2vec.png";
import "../static/css/Work.css";

export default function Work() {
  return (
    <div className="section work ">
      <div className="slide">
        <h2 className="section-heading">Work Experience</h2>
        <Fade bottom>
          <div className="experience-cards-div">
            <WorkCard
              cardInfo={{
                company: "Telenor Microfinance Bank Limited",
                companyLink: "https://x.company/projects/everyday-robots/",
                logo: easypaisaLogo,
                desc:
                  "Researched new robotic grasp representations that used data embeddings in images to improve performance on an end-to-end RL grasping policy.",
                date: "Jun 2019 - Dec 2019",
                role: "Project Intern",
                team: "The Everyday Robot Project",
                descBullets: [
                  "Image embeddings leverage translational invariance of CNNs since a successful grasp is independent of the surrounding environment.",
                ],
              }}
            />
            <WorkCard
              cardInfo={{
                company: "Google[X]",
                companyLink: "https://x.company/projects/everyday-robots/",
                logo: synergyLogo,
                desc:
                  "Developed an end-to-end solution to remotely teleoperate robots using an Oculus Quest.",
                date: "Summer 2019",
                role: "Robotics Software Intern",
                descBullets: [
                  "Wrote client and server code to set up and manage communication over HTTP.",
                  "This interface is actively being used to collect data so that robots can autonomously learn to perform new tasks.",
                ],
              }}
            />
            <WorkCard
              cardInfo={{
                company: "Google",
                companyLink:
                  "https://chromium.googlesource.com/infra/infra/+/master/go/src/infra/tricium/README.md",
                logo: vecLogo,
                desc:
                  "Developed a suite of static analyzers for Tricium, an automated code review tool for Chrome developers.",
                date: "Summer 2018",
                role: "Software Engineering Intern",
                descBullets: [
                  "Analyzers include Python/C++ linters, comment spell checkers and whitespace checkers.",
                  "The analyzers run 1,000’s reqs/hour and have generated hundreds of automated comments across Chrome dev teams.",
                ],
              }}
            />
            <WorkCard
            cardInfo={{
              company: "Carnegie Mellon University",
              companyLink: "https://www.cs.cmu.edu/~charlie/courses/17-214",
              logo: easypaisaLogo,
              desc:
                "Taught concepts of design for complex systems, object oriented programming, techniques for robustness and concurrent software.",
              date: "Fall 2018",
              role: "TA | Principles of Software Construction",
              descBullets: [
                "Held recitations, office hours and course-wide exam review sessions for 100+ students.",
                "Provided medium-scale software design and homework feedback.",
              ],
            }}
          />
          <WorkCard
            cardInfo={{
              company: "Microsoft",
              logo: easypaisaLogo,
              companyLink:
                "https://www.microsoft.com/en-us/account/authenticator",
              desc:
                "Spearheaded the technical specification, user experience design and the implementation of various features for the Microsoft Authenticator Android app:",
              date: "Summer 2017",
              role: "Explore Intern",
              descBullets: [
                "Cloud-based backup and restore for 2FA accounts.",
                "In-app Microsoft account profile picture updates.",
              ],
              headerColor: "linear-gradient(315deg, #3f0d12 0%, #a71d31 74%)",
            }}
          />
          </div>
        </Fade>
      </div>

    </div>
  );
}
